english:
We noticed that the password changed for your Roblox account: {userName}. If you didn't intend to change it, or you think someone else changed it by mistake, please click this link to undo the action:
{urlWithTicket}

If you are happy with your new Roblox password, you don't have to do anything! It's already set up. Please do not reply to this message. If you have any questions, please see the Roblox help page (https://www.roblox.com/help).

translation:
Nous avons remarqué que le mot de passe de votre compte {userName} a été modifié. Au cas où ce changement n'était pas intentionnel, ou si vous pensez que quelqu'un peut l'avoir effectué à votre place par accident, veuillez cliquer sur le lien suivant afin d'annuler la modification : 
{urlWithTicket}

. Si vous aviez bel et bien demandé à changer le mot de passe de votre compte Roblox, alors tout est paré ! Merci de ne pas répondre à ce message. Pour toute question, n'hésitez pas à consulter la page d'aide de Roblox (https://www.roblox.com/help).

english:
Moving forward, subscribers will be granted a monthly lump sum of Robux instead of receiving it in daily increments. Today, we’re depositing {robuxAmount} Robux in your account to make up for the remaining amount you would have earned this month.
{newLine}{newLine}
Check your Roblox Inbox for more details.

translation:
À partir de maintenant, les abonnés recevront tous leurs Robux une fois par mois au lieu de tous les jours ! Aujourd'hui, tu vas recevoir tes Robux restants pour le mois. Tu recevras : {robuxAmount} Robux.
{newLine}{newLine}
Vérifie tes messages pour en savoir plus à propos de tes paiements et de l'abonnement Premium.

